import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Define the XSS payload
    const xssPayload = "<script>alert('XSS Vulnerability')</script>";

    // Locate the search input and type the payload
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', xssPayload);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_payload_entered.png'));

    // Locate and click the search button
    await page.waitForSelector('button.search-btn', { timeout: 5000 });
    await page.click('button.search-btn');

    // Take a screenshot after submitting the payload
    // Note: Playwright auto-dismisses alerts, so we won't see it, but this confirms the action.
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_submit.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_submit.png'));

    // Extract the value from the input field to confirm it was entered
    const enteredValue = await page.inputValue('#searchInput');

    return {
      success: true,
      action: "Attempted XSS injection via the search input field.",
      extractedData: {
        payloadUsed: xssPayload,
        valueInSearchBox: enteredValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to attempt XSS via search input.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
